package cn.com.bohui.bohuifin.bean;/** * 表名：t_manager */import java.io.Serializable;public class ManagerBean extends BaseUserBean implements        Serializable {    /**     *     */    private static final long serialVersionUID = 1L;    private String managerId;    private String managerName;    private String trueName;    private String nickName;    private long deptId;    private int authorityGroupId;    public String getManagerId() {        return managerId;    }    public void setManagerId(String managerId) {        this.managerId = managerId;    }    public String getManagerName() {        return managerName;    }    public void setManagerName(String managerName) {        this.managerName = managerName;    }    public String getTrueName() {        return trueName;    }    public void setTrueName(String trueName) {        this.trueName = trueName;    }    public String getNickName() {        return nickName;    }    public void setNickName(String nickName) {        this.nickName = nickName;    }    public long getDeptId() {        return deptId;    }    public void setDeptId(long deptId) {        this.deptId = deptId;    }    public int getAuthorityGroupId() {        return authorityGroupId;    }    public void setAuthorityGroupId(int authorityGroupId) {        this.authorityGroupId = authorityGroupId;    }}